CREATE TABLE invoice(
   invoice_id          INTEGER  NOT NULL PRIMARY KEY 
  ,customer_id         INTEGER  NOT NULL
  ,invoice_date        VARCHAR(19) NOT NULL
  ,billing_address     VARCHAR(40) NOT NULL
  ,billing_city        VARCHAR(19) NOT NULL
  ,billing_state       VARCHAR(6) NOT NULL
  ,billing_country     VARCHAR(14) NOT NULL
  ,billing_postal_code VARCHAR(10) NOT NULL
  ,total               VARCHAR(18) NOT NULL
);
